import React from 'react'
import jsPDF from "jspdf";
import "jspdf-autotable";

const ExportPdf = ({columns, items, name, appl, area, room, startDate, endDate, chkdBy, verifiedBy}) => {
    const  somersetImage = "data:image/png;base64,";

    const  sasImage ="data:image/png;base64,"


      // const demoColumns = ["TS","vial filling PND/LAF/900","vial filling PND/LAF/900","vial filling PND/LAF/900","vial filling PND/LAF/900","vial filling PND/LAF/900","vial filling PND/LAF/900"];

    const exportPDF = () => {
        const unit = "pt";
        const size = "A4"; // Use A1, A2, A3 or A4
        const orientation = "landscape"; // portrait or landscape
        var tFontSize;
        columns && columns.length >= 5 ? tFontSize = 6 : tFontSize = 8;
        const marginLeft = 40;
        const doc = new jsPDF(orientation, unit, size);
    
        doc.setFontSize(15);
    
        const title = `${appl} ${name}`;
        const data = items.map(elt => [elt.TS]);
    
        let content = {
          startY: 50,
          // head: headers,
          // body: data
        };
       
        doc.addImage(somersetImage, 'PNG', 40, 20, 90, 40)
        doc.setTextColor("#black")
        doc.setFontSize(18)
        doc.text(title, 220, 39);
        // doc.addImage(sasImage, 'PNG', 505, 20, 50, 30)
        doc.setTextColor("#1D1D1D")
        doc.setLineWidth(0.5)
        // doc.line(40,40,50,100,)
        
        doc.setFontSize(7.4)
        doc.text(`Application    ${appl}`, 410, 32);
        doc.text(`Area    ${area} `, 410, 44);
        doc.text(`Room  ${room} `, 410, 55);
        doc.text(`StartDateTime - ${startDate}`, 137, 55);
        doc.text(`EndDateTime - ${endDate}`, 275, 55);
        doc.line(40, 20, 555, 20); //mainupperline
        doc.line(40, 19.5, 40, 60); //main leftline
        doc.line(130, 19.5, 130, 59.5); // image rightline
        doc.line(40, 59, 555, 59); //mainlowerline
        doc.line(555, 19.5, 555, 60); // main righline
        doc.line(130, 45, 408, 45); // report title bottomline
        doc.line(408, 19.5, 408, 59.5); // app, room area left line
        doc.line(408, 35, 555, 35); //app bottom line
        doc.line(408, 47, 555, 47); //area bottom line
        doc.line(451, 19.5, 451, 35); //  application right line
        doc.line(432, 35, 432, 59.5); //  room area right line
        doc.line(270, 45, 270, 59.5); //  datetime middle line


        // doc.autoTable(content);
        doc.autoTable({
          startY: 60,
          styles: {
            fontSize: tFontSize
          },
          headStyles:{
            valign: 'middle',
            halign : 'center'
          },
          columnStyles: { 
            Variable: { cellWidth: 200} 
          },
          bodyStyles:{
            valign: 'middle',
            halign : 'center'
          },
           
          didDrawPage: function (items) {
    
            var str = `Page  ${doc.internal.getNumberOfPages()}` 
        
            doc.setFontSize(10);
        
            // jsPDF 1.4+ uses getWidth, <1.4 uses .width
            var pageSize = doc.internal.pageSize;
            var pageHeight = pageSize.height
              ? pageSize.height
              : pageSize.getHeight();
            doc.text(str, 270, pageHeight - 10);
            doc.text(`Checked By - ${chkdBy}`,items.settings.margin.left, pageHeight - 10);
            doc.text(`Verified By - ${verifiedBy}`,435, pageHeight - 10);
          },
          columns: columns.map((col)=>({header:col.Header, dataKey:col.accessor})),
          body:items
        });
        doc.save(`${appl}${name}-${startDate} - ${endDate}.pdf`)
      }
  return (
    <button type="" className='btn btn-sm btn-info' onClick={exportPDF}>Export</button>
  )
}


export default ExportPdf